    @staticmethod
    def generate_temp_space():
        """
        Provides a temp name, temp directory name and uniqueid

        Returns
        -------
        [temp_name, temp_directory_name, unique_id]
        """
        temp_name = tempfile.mkdtemp()
        temp_directory_name = os.path.dirname(temp_name)
        unique_id = uuid.uuid1().clock_seq
        return [temp_name, temp_directory_name, unique_id]

    @staticmethod
    def get_test_data_folder():
        cwd = os.getcwd()
        if os.path.basename(cwd).lower() == 'tests':
            return os.path.join(os.getcwd(), 'test_data')
        elif os.path.basename(cwd).lower() == 'flightline':
            return os.path.join(os.getcwd(), 'tests','test_data')
        else:
            return os.getcwd()

    @staticmethod
    def get_map_document():
        return os.path.join(Resources.get_test_data_folder(), 'test_mxd.mxd')

    @staticmethod
    def get_total_polygons_lyr_file():
        return os.path.join(Resources.get_test_data_folder(), 'total_polygons.lyr')

    @staticmethod
    def create_summary_text_file(machine_name, download_time):

        records = 'Area (nominal):         2117.11 ha\nArea (real):            1943.83 ha\nDistance traveling:     183.48 km\nDistance spreading:       81.43 km\n'

        temp_name, temp_directory, unique_id = Resources.generate_temp_space()

        #os.mkdir(temp_name)
        os.mkdir(os.path.join(temp_name,machine_name))
        os.mkdir(os.path.join(temp_name, machine_name, download_time))

        txt_file = os.path.join(temp_name, machine_name, download_time,'summary.txt')
        open_txt_file = open(txt_file, mode='w')
        open_txt_file.write(records)
        open_txt_file.close()
        return temp_name, txt_file

