    @staticmethod
    def create_operation_start_end_time_table(state_type=None):
        """
        Creates a operation_start_end_time table. The state_type
        defines the following:
        'Base' = An empty featureclass
        'Partial' = A featureclass with records where the machine, downloadtime etc.. are null
        'Full' = A featureclass where all records have attributes

        Parameters
        state_type : str of type ['Base','Partial','Full']
        """
        valid_state_types = ['Base','Partial','Full',None]

        if state_type not in valid_state_types:
            raise AttributeError('state_type not one of the following: {0}'.format(valid_state_types))

        records = [[1, datetime.datetime(2017, 5, 17, 9, 10), None]]

        operation_starts_table = arcpy.CreateTable_management(out_path='in_memory', out_name='operation_start_end_time')

        arcpy.AddField_management(in_table=operation_starts_table, field_name='Operation_Start_Time', field_type='DATE')
        arcpy.AddField_management(in_table=operation_starts_table, field_name='Operation_End_Time', field_type='DATE')
        desc = arcpy.Describe(operation_starts_table)

        if state_type == 'Base':
            return operation_starts_table

        with arcpy.da.InsertCursor(operation_starts_table, [desc.oidFieldName, 'Operation_Start_Time', 'Operation_End_Time']) as cursor:
            for row in records:
                cursor.insertRow(row)

        return operation_starts_table

