class TestUpdateTotallinesFeatureclass(unittest.TestCase):

    def setUp(self):
        arcpy.env.overwriteOutput = True
        self.lines_featureclass = Resources.create_total_lines_featureclass(state_type='Partial')
        self.total_polygons_featureclass = Resources.create_total_polygons_featureclass()

    def tearDown(self):
        arcpy.env.overwriteOutput = False
        arcpy.Delete_management(in_data=self.lines_featureclass)
        arcpy.Delete_management(in_data=self.total_polygons_featureclass)

    def test_update_total_lines_featureclass(self):

        featureclass_handler.update_totallines_featureclass(self.lines_featureclass, self.total_polygons_featureclass, 'NSB', '1102', False)

        helicopter_regos = []
        download_times = []
        buckets = []
        buffers = []

        with arcpy.da.SearchCursor(self.lines_featureclass, ['Machine','DL_Time','Bucket','Buffer']) as cursor:
            for row in cursor:
                helicopter_regos.append(row[0])
                download_times.append(row[1])
                buckets.append(row[2])
                buffers.append(row[3])

        helicopter_regos = list(set(helicopter_regos))
        download_times = list(set(download_times))
        buckets = list(set(buckets))
        buffers = list(set(buffers))


        # Test that helicopter_rego has been updated
        self.assertTrue(len(helicopter_regos) == 1, msg = "Helicopter regos did not return a single value, got: {0}".format(helicopter_regos))
        self.assertTrue(helicopter_regos[0] == 'NSB', msg = 'Helicopter regos is different, expected: {0} \n got: {1}'.format('NSB',helicopter_regos[0]))

        # Test that the download_time has been updated
        self.assertTrue(len(download_times) == 1, msg = "Download times did not return a single value, got: {0}".format(download_times))
        self.assertTrue(download_times[0] == '1102', msg = 'Download times is different, expected: {0} \n got: {1}'.format('1102',download_times[0]))

        # Test that the bucket has been updated
        self.assertTrue(len(buckets) == 1, msg = "Buckets did not return a single value, got: {0}".format(buckets))

        # Test that the buffer has been updated
        self.assertTrue(len(buffers) == 1, msg = "Buffers did not return a single value, got: {0}".format(buffers))

        # Test that new records were added the total_polygons_featureclass
        total_polygon_count = int(arcpy.GetCount_management(self.total_polygons_featureclass).getOutput(0))
        self.assertGreater(total_polygon_count, 0, msg = 'No new records added to total_polygons_featureclass')


