class TestConvertSecondaryPointsToLines(unittest.TestCase):

    def setUp(self):
        self.total_points_featureclass = Resources.create_total_points_featureclass(state_type='Base')
        self.total_lines_featureclass = Resources.create_total_lines_featureclass(state_type='Base')
        self.total_polygons_featureclass = Resources.create_total_polygons_featureclass()
        self.flight_path_featureclass = Resources.create_flight_path_featureclass(state_type='Base')
        self.operations_start_times_table = Resources.create_operation_start_end_time_table(state_type='Full')
        self.log_featureclass = Resources.create_log_featureclass()
        self.secondary_featureclass = Resources.create_secondary_featureclass()

    def tearDown(self):
        arcpy.Delete_management(self.total_points_featureclass)
        arcpy.Delete_management(self.total_lines_featureclass)
        arcpy.Delete_management(self.flight_path_featureclass)
        arcpy.Delete_management(self.operations_start_times_table)

    def test_convert_secondary_points_to_lines(self):
        helicopter_rego = 'NSB'
        download_time = '1102'

        # Running through the workflow to set up the datasets
        log_shapefile_location = self.log_featureclass.getOutput(0) # This doesn't actually need to exist
        secondary_shapefile_location = self.secondary_featureclass.getOutput(0) # This doesn't actually need to exist
        tracmap_data_directory = r'C:\ProjectFolder\TracmapData\{0}'.format(download_time) # This doesn't actually need to exist

        featureclass_handler.merge_tracmap_data_featureclass(tracmap_data_directory, log_shapefile_location, self.total_lines_featureclass)
        featureclass_handler.update_totallines_featureclass(self.total_lines_featureclass, self.total_polygons_featureclass, helicopter_rego, download_time, False)
        featureclass_handler.merge_tracmap_data_featureclass(tracmap_data_directory, secondary_shapefile_location, self.total_points_featureclass)
        featureclass_handler.update_totalpoints_featureclass(self.total_points_featureclass, helicopter_rego, download_time)

        # Test that new records added
        records_added_count = featureclass_handler.convert_secondary_points_to_lines(
            self.total_points_featureclass,
            self.total_lines_featureclass,
            self.flight_path_featureclass,
            self.operations_start_times_table,
            helicopter_rego,
            download_time)

        actual_record_count = int(arcpy.GetCount_management(self.flight_path_featureclass).getOutput(0))

        self.assertEqual(records_added_count, actual_record_count, msg = "Function reported adding {0} records but record count is {1}".format(records_added_count, actual_record_count))
        self.assertGreater(actual_record_count, 0, msg = 'No new records added to flight_path_featureclass')


