        self.assertEqual(feature_count, len(feature_dict), msg = "Expected size of dict to be: {0}, got {1}".format(feature_count, len(feature_dict)))
        self.assertTrue(feature_dict.has_key(single_record[0]), msg = "Dictionary should have key: {0}".format(single_record[0]))
        self.assertEqual(feature_dict[single_record[0]][0], single_record[1], msg = "Expected Record: {0}, Got: {1}".format(feature_dict[single_record[0]][0],single_record[1]))
        self.assertEqual(feature_dict[single_record[0]][1], single_record[2], msg = "Expected Record: {0}, Got: {1}".format(feature_dict[single_record[0]][1],single_record[2]))
